-- Wombats Project Create Tables File and Triggers

/* Creates initial table called project to store all information pertaining to owners, wombats, races, and etc.
Table project will not part of the final table schema */

CREATE TABLE project (
	Owner_Name VARCHAR(255),
	Owner_City VARCHAR(255),
	Owner_State VARCHAR(255),
	Wombat_Name VARCHAR(255),
	Birthdate DATE,
	Gender ENUM ('M','F'),
	Breed_Name VARCHAR(255),
	Nom_de_Course VARCHAR(255),
	Meet_Date DATE,
	Meet_Host VARCHAR(255),
	Entered_By VARCHAR(255),
	Distance INT,
	Time FLOAT,
	Induction_to_Hall_of_Champions_Date DATE
); 

